import React from 'react'
import './Booking.css'
import {Form,FormGroup,ListGroup,ListGroupItem,Button} from 'reactstrap'

const Booking = ({tour}) => {
  return (
    <>
        <div className="booking">
            .booking__top.d-flex.align-items-center.justify-content-between
        </div>
    </>
  )
}

export default Booking
